import QuestionModel from "./QuestionModel";

export default class QuizModel{

    private _quizId :number;
    private _title :string;
    private _code :string;
    private _questions : Array<QuestionModel>;

    constructor(quizId:number,title:string,code:string,questions:Array<QuestionModel>){
        this._quizId = quizId;
        this._title  = title;
        this._code = code;
        this._questions = questions;
    }

    
    //getters setters
    get quizId():number{
        return this._quizId;
    }
    get title():string{
        return this._title;
    }
    get code():string{
        return this._code;
    }
    get questions():Array<QuestionModel>{
        return this._questions;
    }

    set quizId(quizId:number){
         this._quizId = quizId;
    }
    set code(code :string){
        this._code = code;
    }
    set title(title:string){
        this._title = title;
    }
    set questions(questions:Array<QuestionModel>){
        this._questions = questions;
    }

}
